                    website: "ironThrone.com"

                }}
            />
            <TeamMember
                info = {{
                    name: "Terrian Lannister",
                    img: "./img/terrian.jpg",
                    position: "Peter Dinklage",
                    phone: "0511111111",
                    email: 'Hand@gmail.com',
                    website: "ironThrone.com"

                }}
            />
            <TeamMember
                info = {{
                    name: "Arya Stark",
